// src/Sidebar.js
import React from 'react';
import './Sidebar.css';

function Sidebar() {
  return (
    <div className="sidebar">
      <h2>GMAO Menu</h2>
      <ul>
        <li><a href="#equipments">Équipements</a></li>
        <li><a href="#tickets">Tickets</a></li>
        <li><a href="#add-equipment">Ajouter Équipement</a></li>
      </ul>
    </div>
  );
}

export default Sidebar;
